import React from 'react'
import {list, ListItem, ListItemAvatar, Avatar, ListItemText, Button, Modal} from '@material-ui/core';
// import './Todo.css';
import db from './firebase';
import DeleteIcon from '@material-ui/icons/Delete';
import {useState} from 'react'
import EditIcon from '@material-ui/icons/Edit';

function Todo(props) {
    const [open, setOpen] = useState(false);
    const handleOpen = () => {
        setOpen=(true);
    };
    return (
        <>
        <Modal
        open={open}
        onClose={e => setOpen(false)}
        >
        <div>
            <h1>I am a Modal</h1>
            <EditIcon onClick={e => setOpen(false)}></EditIcon>
        </div>
        </Modal>
        <list>
            <ListItem> 
                <ListItemAvatar>
                </ListItemAvatar>
                    <ListItemText primary={props.todo.todo} secondary="Dummy deadline">
                    </ListItemText>
                    <Button onClick={e => setOpen(true)}>Edit</Button>
                    <DeleteIcon variant="contained" color="secondary" onClick={event => db.collection('todos').doc(props.todo.id).delete()}>DELETE</DeleteIcon>

            </ListItem>
        </list>
        </>
    )
}

export default Todo
